	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				<code>
					'Hola, soy el Ingeniero en Sistemas Rodolfo Agust√≠n Silva Messano. Si te gusto mi app, te invito a que visites
					mis redes sociales.',
				</code>
			</WeatherCard>
		</>
	);
};

export default SocialMedia;
